import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
        height: '100vh',
        width: '8%',
        backgroundColor: 'black',
        borderColor: 'white',
        borderWidth: '1px',
        display: 'flex',
        alignItems: 'center',
    },
    menuIcon: {
        width: '100px',
        height: '100px'
    }
});
